import { useSelector, useDispatch } from 'react-redux';
import { useEffect } from 'react';
import { getAgentTickets, reset } from '../features/tickets/ticketSlice';
import Spinner from '../components/Spinner';
import { BackButton } from '../components/BackButton';
import TicketItem from '../components/TicketItem';
import { useHistory } from 'react-router-dom';

// Helper function to get the status text from the status number
function Tickets() {
  const { tickets, isLoading, isSuccess } = useSelector(
    (state) => state.tickets
  )
  const dispatch = useDispatch()
  const history = useHistory();

  useEffect(() => {
    return () => {
      if (isSuccess) {
        dispatch(reset())
      }
    }
  }, [dispatch, isSuccess])

  useEffect(() => {
    dispatch(getAgentTickets())
  }, [dispatch])

  const handleChangeStatus = (ticketId) => {
    history.push(`/change-status/${ticketId}`);
  };

  if (isLoading) {
    return <Spinner />
  }

  return (
    <>
      <BackButton url="/" />
      <h1>My Assigned Tickets</h1>
      <div className="tickets">
        <div className="ticket-headings">
          <div>Date</div>
          <div>Ticket Name</div>
          <div>Status</div>
          <div>Change status</div>
        </div>
        {tickets.length > 0 ? (
          tickets.map((ticket) => (
            <div key={ticket._id} className="ticket-item">
              <TicketItem ticket={ticket} />
              <button onClick={() => handleChangeStatus(ticket._id)}>Change Status</button>
            </div>
          ))
        ) : (
          <p>No tickets found</p>
        )}
      </div>
    </>
  );
}

export default Tickets;
